function defineStructure() {
    addColumn("TIPO");
    addColumn("CODCOLIGADA");
    addColumn("CODCCUSTO");
    addColumn("CENTRO_DE_CUSTO");
    addColumn("SETOR_SOLICITANTE");
    addColumn("APROVADOR");
    addColumn("TODOS", DatasetFieldType.STRING);
    setKey(["CODCOLIGADA", "CODCCUSTO", "CENTRO_DE_CUSTO", "APROVADOR", "SETOR_SOLICITANTE", "TIPO"]);
    addIndex(["CODCOLIGADA", "CODCCUSTO", "CENTRO_DE_CUSTO", "APROVADOR",, "SETOR_SOLICITANTE", "TIPO"]);
}

function onSync(lastSyncDate) {
    var ds = DatasetBuilder.newDataset();
    var tempDataset = getDefaultValues(); // consulta a fonte de dados do dataset
    for (var a = 0; a < tempDataset.length; a++) {
        ds.addOrUpdateRow(tempDataset[a]);
    }
    return ds;
}

function createDataset(fields, constraints, sortFields) {

    var ds = DatasetBuilder.newDataset();
    ds.addColumn("TIPO");
    ds.addColumn("CODCOLIGADA");
    ds.addColumn("CODCCUSTO");
    ds.addColumn("CENTRO_DE_CUSTO");
    ds.addColumn("SETOR_SOLICITANTE");
    ds.addColumn("APROVADOR");
    ds.addColumn("TODOS");

    var tempDataset = getDefaultValues(); // consulta a fonte de dados do dataset
    var tipo;
    var codccusto;
    var codcoligada;
    var ccusto;
    var setor_solicitante;
    var aprovador;
    var todos;

    if (constraints != null && constraints.length && constraints[0].fieldName != "sqlLimit") { //se tiver constraint filtra
        for (var index = 0; index < constraints.length; index++) {
            tipo = constraints[index].fieldName == "TIPO" ? constraints[index].initialValue : tipo;
            codccusto = constraints[index].fieldName == "CODCCUSTO" ? constraints[index].initialValue : codccusto;
            codcoligada = constraints[index].fieldName == "CODCOLIGADA" ? constraints[index].initialValue : codcoligada;
            ccusto = constraints[index].fieldName == "CENTRO_DE_CUSTO" ? constraints[index].initialValue : ccusto;
            setor_solicitante = constraints[index].fieldName == "SETOR_SOLICITANTE" ? constraints[index].initialValue : setor_solicitante;
            aprovador = constraints[index].fieldName == "APROVADOR" ? constraints[index].initialValue : aprovador;
            todos = constraints[index].fieldName == "TODOS" ? constraints[index].initialValue : todos;
        }
        /* Implemente o filtro que foi definido, somente 1 por consulta*/
        if (tipo != undefined) { ds = getMatchValue(tempDataset, tipo, 0); }
        if (codccusto != undefined) { ds = getMatchValue(tempDataset, codccusto, 1); }
        if (codcoligada != undefined) { ds = getMatchValue(tempDataset, codcoligada, 2); }
        if (ccusto != undefined) { ds = getMatchValue(tempDataset, ccusto, 3); }
        if (setor_solicitante != undefined) { ds = getMatchValue(tempDataset, setor_solicitante, 4); }
        if (aprovador != undefined) { ds = getMatchValue(tempDataset, aprovador, 5); }
        if (todos != undefined) { ds = getMatchValue(tempDataset, todos, 6); }
    } else { // se não tiver constraint adiciona todas as linhas do objeto no retorno
        for (var a = 0; a < tempDataset.length; a++) {
            ds.addRow(tempDataset[a]);
        }
    }
    return ds;
}

/**
 * Monta o novo dataset com base nos parâmetros definidos
 * @param {object} list espera um objeto ou array de objetos 
 * @param {string} filter espera o valor que foi passado via constraint do dataset 
 * @param {int} position a posição onde o valor alvo será validado
 * @returns retorna uma novo dataset com os valores que atendam a condição
 */
function getMatchValue(list, filter, position) {
    var ds = DatasetBuilder.newDataset();
    ds.addColumn("TIPO");
    ds.addColumn("CODCCUSTO");
    ds.addColumn("CODCOLIGADA");
    ds.addColumn("CENTRO_DE_CUSTO");
    ds.addColumn("SETOR_SOLICITANTE");
    ds.addColumn("APROVADOR");
    ds.addColumn("TODOS");

    for (var a = 0; a < list.length; a++) {
        /**  Irá adicionar ao dataset somente as linhas que atenderem a condição
         * Por estarmos usando indexOf, vai função vai trabalhar como um '%like%' no banco de dados */
        if (String(list[a][position]).toUpperCase().indexOf(String(filter).toUpperCase()) >= 0) {
            ds.addRow(list[a]);
        }
    }
    return ds;
}

